import React from "react";
import { useState } from "react";

const RouterService = () => {
    const [data, setData] = useState("");

    const inputField = (event) => {
        const updatedData = event.target.value;
        setData(updatedData);
    }
    return (
        <>
            <h1 className="text-capitalize text-primary">Search For Our services and items</h1><br />
            <div className="container w-50 my-5 text-center serviceSearch" style={{ border: "2px solid" }}>

                <div className="row">
                    <div className="col-12">
                        <input type="text" onChange={inputField} value={data} placeholder="seacrh anything" />
                    </div><br />
                    {data}

                    <div className="col-12 my-4">
                        <figure>
                            <img src="" alt="display image" />
                        </figure>
                    </div>

                </div>
            </div>

        </>
    );
}

export default RouterService;
